/** Main entry point of this phase for testing code. */
public Scope processForTesting(Node externsRoot, Node jsRoot) {
  Preconditions.checkState(scopeCreator == null);
  Preconditions.checkState(topScope == null);

  Preconditions.checkState(jsRoot.getParent() != null);
  Node externsAndJsRoot = jsRoot.getParent();

  scopeCreator = new MemoizedScopeCreator(new TypedScopeCreator(compiler));
  topScope = scopeCreator.createScope(externsAndJsRoot, null);

  TypeInferencePass inference = new TypeInferencePass(compiler,
      reverseInterpreter, topScope, scopeCreator);

  inference.process(externsRoot, jsRoot);
  process(externsRoot, jsRoot);

  return topScope;
}

/**
 * Main entry point for this phase of processing. This follows the pattern for
 * JSCompiler phases.
 *
 * @param externsRoot The root of the externs parse tree.
 * @param jsRoot The root of the input parse tree to be checked.
 */
@Override
public void process(Node externsRoot, Node jsRoot) {
  Preconditions.checkNotNull(scopeCreator);
  Preconditions.checkNotNull(topScope);

  Node externsAndJs = jsRoot.getParent();
  Preconditions.checkState(externsAndJs != null);
  Preconditions.checkState(
      externsRoot == null || externsAndJs.hasChild(externsRoot));

  if (externsRoot != null) {
    check(externsRoot, true);
  }
  check(jsRoot, false);
}

public void check(Node node, boolean externs) {
  Preconditions.checkNotNull(node);

  NodeTraversal t = new NodeTraversal(compiler, this, scopeCreator);
  inExterns = externs;
  t.traverseWithScope(node, topScope);
  if (externs) {
    inferJSDocInfo.process(node, null);
  } else {
    inferJSDocInfo.process(null, node);
  }
}

/**
 * Traverses a parse tree recursively with a scope, starting with the given
 * root. This should only be used in the global scope. Otherwise, use
 * {@link #traverseAtScope}.
 */
void traverseWithScope(Node root, Scope s) {
  Preconditions.checkState(s.isGlobal());

  inputId = null;
  sourceName = "";
  curNode = root;
  pushScope(s);
  traverseBranch(root, null);
  popScope();
}

/**
 * Traverses a branch.
 */
@SuppressWarnings("fallthrough")
private void traverseBranch(Node n, Node parent) {
  int type = n.getType();
  if (type == Token.SCRIPT) {
    inputId = n.getInputId();
    sourceName = getSourceName(n);
  }

  curNode = n;
  if (!callback.shouldTraverse(this, n, parent)) return;

  switch (type) {
    case Token.FUNCTION:
      traverseFunction(n, parent);
      break;

    default:
      for (Node child = n.getFirstChild(); child != null; ) {
        // child could be replaced, in which case our child node
        // would no longer point to the true next
        Node next = child.getNext();
        traverseBranch(child, n);
        child = next;
      }
      break;
  }

  curNode = n;
  callback.visit(this, n, parent);
}

/**
 * Traverses a branch.
 */
@SuppressWarnings("fallthrough")
private void traverseBranch(Node n, Node parent) {
  int type = n.getType();
  if (type == Token.SCRIPT) {
    inputId = n.getInputId();
    sourceName = getSourceName(n);
  }

  curNode = n;
  if (!callback.shouldTraverse(this, n, parent)) return;

  switch (type) {
    case Token.FUNCTION:
      traverseFunction(n, parent);
      break;

    default:
      for (Node child = n.getFirstChild(); child != null; ) {
        // child could be replaced, in which case our child node
        // would no longer point to the true next
        Node next = child.getNext();
        traverseBranch(child, n);
        child = next;
      }
      break;
  }

  curNode = n;
  callback.visit(this, n, parent);
}

/**
 * This is the meat of the type checking.  It is basically one big switch,
 * with each case representing one type of parse tree node.  The individual
 * cases are usually pretty straightforward.
 *
 * @param t The node traversal object that supplies context, such as the
 * scope chain to use in name lookups as well as error reporting.
 * @param n The node being visited.
 * @param parent The parent of the node n.
 */
@Override
public void visit(NodeTraversal t, Node n, Node parent) {
  JSType childType;
  JSType leftType, rightType;
  Node left, right;
  // To be explicitly set to false if the node is not typeable.
  boolean typeable = true;

  switch (n.getType()) {
    case Token.NAME:
      typeable = visitName(t, n, parent);
      break;

    case Token.PARAM_LIST:
      typeable = false;
      break;

    case Token.COMMA:
      ensureTyped(t, n, getJSType(n.getLastChild()));
      break;

    case Token.TRUE:
    case Token.FALSE:
      ensureTyped(t, n, BOOLEAN_TYPE);
      break;

    case Token.THIS:
      ensureTyped(t, n, t.getScope().getTypeOfThis());
      break;

    case Token.NULL:
      ensureTyped(t, n, NULL_TYPE);
      break;

    case Token.NUMBER:
      ensureTyped(t, n, NUMBER_TYPE);
      break;

    case Token.STRING:
      ensureTyped(t, n, STRING_TYPE);
      break;

    case Token.STRING_KEY:
      typeable = false;
      break;

    case Token.GETTER_DEF:
    case Token.SETTER_DEF:
      // Object literal keys are handled with OBJECTLIT
      break;

    case Token.ARRAYLIT:
      ensureTyped(t, n, ARRAY_TYPE);
      break;

    case Token.REGEXP:
      ensureTyped(t, n, REGEXP_TYPE);
      break;

    case Token.GETPROP:
      visitGetProp(t, n, parent);
      typeable = !(parent.isAssign() &&
                   parent.getFirstChild() == n);
      break;

    case Token.GETELEM:
      visitGetElem(t, n);
      // The type of GETELEM is always unknown, so no point counting that.
      // If that unknown leaks elsewhere (say by an assignment to another
      // variable), then it will be counted.
      typeable = false;
      break;

    case Token.VAR:
      visitVar(t, n);
      typeable = false;
      break;

    case Token.NEW:
      visitNew(t, n);
      break;

    case Token.CALL:
      visitCall(t, n);
      typeable = !parent.isExprResult();
      break;

    case Token.RETURN:
      visitReturn(t, n);
      typeable = false;
      break;

    case Token.DEC:
    case Token.INC:
      left = n.getFirstChild();
      checkPropCreation(t, left);
      validator.expectNumber(t, left, getJSType(left), "increment/decrement");
      ensureTyped(t, n, NUMBER_TYPE);
      break;

    case Token.NOT:
      ensureTyped(t, n, BOOLEAN_TYPE);
      break;

    case Token.VOID:
      ensureTyped(t, n, VOID_TYPE);
      break;

    case Token.TYPEOF:
      ensureTyped(t, n, STRING_TYPE);
      break;

    case Token.BITNOT:
      childType = getJSType(n.getFirstChild());
      if (!childType.matchesInt32Context()) {
        report(t, n, BIT_OPERATION, NodeUtil.opToStr(n.getType()),
            childType.toString());
      }
      ensureTyped(t, n, NUMBER_TYPE);
      break;

    case Token.POS:
    case Token.NEG:
      left = n.getFirstChild();
      validator.expectNumber(t, left, getJSType(left), "sign operator");
      ensureTyped(t, n, NUMBER_TYPE);
      break;

    case Token.EQ:
    case Token.NE:
    case Token.SHEQ:
    case Token.SHNE: {
      left = n.getFirstChild();
      right = n.getLastChild();

      if (left.isTypeOf()) {
        if (right.isString()) {
          checkTypeofString(t, right, right.getString());
        }
      } else if (right.isTypeOf() && left.isString()) {
        checkTypeofString(t, left, left.getString());
      }

      leftType = getJSType(left);
      rightType = getJSType(right);

      // We do not want to warn about explicit comparisons to VOID. People
      // often do this if they think their type annotations screwed up.
      //
      // We do want to warn about cases where people compare things like
      // (Array|null) == (Function|null)
      // because it probably means they screwed up.
      //
      // This heuristic here is not perfect, but should catch cases we
      // care about without too many false negatives.
      JSType leftTypeRestricted = leftType.restrictByNotNullOrUndefined();
      JSType rightTypeRestricted = rightType.restrictByNotNullOrUndefined();

      TernaryValue result = TernaryValue.UNKNOWN;
      if (n.getType() == Token.EQ || n.getType() == Token.NE) {
        result = leftTypeRestricted.testForEquality(rightTypeRestricted);
        if (n.isNE()) {
          result = result.not();
        }
      } else {
        // SHEQ or SHNE
        if (!leftTypeRestricted.canTestForShallowEqualityWith(
                rightTypeRestricted)) {
          result = n.getType() == Token.SHEQ ?
              TernaryValue.FALSE : TernaryValue.TRUE;
        }
      }

      if (result != TernaryValue.UNKNOWN) {
        report(t, n, DETERMINISTIC_TEST, leftType.toString(),
            rightType.toString(), result.toString());
      }
      ensureTyped(t, n, BOOLEAN_TYPE);
      break;
    }

    case Token.LT:
    case Token.LE:
    case Token.GT:
    case Token.GE:
      leftType = getJSType(n.getFirstChild());
      rightType = getJSType(n.getLastChild());
      if (rightType.isNumber()) {
        validator.expectNumber(
            t, n, leftType, "left side of numeric comparison");
      } else if (leftType.isNumber()) {
        validator.expectNumber(
            t, n, rightType, "right side of numeric comparison");
      } else if (leftType.matchesNumberContext() &&
                 rightType.matchesNumberContext()) {
        // OK.
      } else {
        // Whether the comparison is numeric will be determined at runtime
        // each time the expression is evaluated. Regardless, both operands
        // should match a string context.
        String message = "left side of comparison";
        validator.expectString(t, n, leftType, message);
        validator.expectNotNullOrUndefined(
            t, n, leftType, message, getNativeType(STRING_TYPE));
        message = "right side of comparison";
        validator.expectString(t, n, rightType, message);
        validator.expectNotNullOrUndefined(
            t, n, rightType, message, getNativeType(STRING_TYPE));
      }
      ensureTyped(t, n, BOOLEAN_TYPE);
      break;

    case Token.IN:
      left = n.getFirstChild();
      right = n.getLastChild();
      rightType = getJSType(right);
      validator.expectString(t, left, getJSType(left), "left side of 'in'");
      validator.expectObject(t, n, rightType, "'in' requires an object");
      if (rightType.isStruct()) {
        report(t, right, IN_USED_WITH_STRUCT);
      }
      ensureTyped(t, n, BOOLEAN_TYPE);
      break;

    case Token.INSTANCEOF:
      left = n.getFirstChild();
      right = n.getLastChild();
      rightType = getJSType(right).restrictByNotNullOrUndefined();
      validator.expectAnyObject(
          t, left, getJSType(left), "deterministic instanceof yields false");
      validator.expectActualObject(
          t, right, rightType, "instanceof requires an object");
      ensureTyped(t, n, BOOLEAN_TYPE);
      break;

    case Token.ASSIGN:
      visitAssign(t, n);
      typeable = false;
      break;

    case Token.ASSIGN_LSH:
    case Token.ASSIGN_RSH:
    case Token.ASSIGN_URSH:
    case Token.ASSIGN_DIV:
    case Token.ASSIGN_MOD:
    case Token.ASSIGN_BITOR:
    case Token.ASSIGN_BITXOR:
    case Token.ASSIGN_BITAND:
    case Token.ASSIGN_SUB:
    case Token.ASSIGN_ADD:
    case Token.ASSIGN_MUL:
      checkPropCreation(t, n.getFirstChild());
      // fall through

    case Token.LSH:
    case Token.RSH:
    case Token.URSH:
    case Token.DIV:
    case Token.MOD:
    case Token.BITOR:
    case Token.BITXOR:
    case Token.BITAND:
    case Token.SUB:
    case Token.ADD:
    case Token.MUL:
      visitBinaryOperator(n.getType(), t, n);
      break;

    case Token.DELPROP:
      ensureTyped(t, n, BOOLEAN_TYPE);
      break;

    case Token.CASE:
      JSType switchType = getJSType(parent.getFirstChild());
      JSType caseType = getJSType(n.getFirstChild());
      validator.expectSwitchMatchesCase(t, n, switchType, caseType);
      typeable = false;
      break;

    case Token.WITH: {
      Node child = n.getFirstChild();
      childType = getJSType(child);
      validator.expectObject(t, child, childType, "with requires an object");
      typeable = false;
      break;
    }

    case Token.FUNCTION:
      visitFunction(t, n);
      break;

    // These nodes have no interesting type behavior.
    case Token.LABEL:
    case Token.LABEL_NAME:
    case Token.SWITCH:
    case Token.BREAK:
    case Token.CATCH:
    case Token.TRY:
    case Token.SCRIPT:
    case Token.EXPR_RESULT:
    case Token.BLOCK:
    case Token.EMPTY:
    case Token.DEFAULT_CASE:
    case Token.CONTINUE:
    case Token.DEBUGGER:
    case Token.THROW:
      typeable = false;
      break;

    // These nodes require data flow analysis.
    case Token.DO:
    case Token.IF:
    case Token.WHILE:
      typeable = false;
      break;

    case Token.FOR:
      if (NodeUtil.isForIn(n)) {
        Node obj = n.getChildAtIndex(1);
        if (getJSType(obj).isStruct()) {
          report(t, obj, IN_USED_WITH_STRUCT);
        }
      }
      typeable = false;
      break;

    // These nodes are typed during the type inference.
    case Token.AND:
    case Token.HOOK:
    case Token.OBJECTLIT:
    case Token.OR:
      if (n.getJSType() != null) { // If we didn't run type inference.
        ensureTyped(t, n);
      } else {
        // If this is an enum, then give that type to the objectlit as well.
        if ((n.isObjectLit())
            && (parent.getJSType() instanceof EnumType)) {
          ensureTyped(t, n, parent.getJSType());
        } else {
          ensureTyped(t, n);
        }
      }
      if (n.isObjectLit()) {
        for (Node key : n.children()) {
          visitObjLitKey(t, key, n);
        }
      }
      break;

    default:
      report(t, n, UNEXPECTED_TOKEN, Token.name(n.getType()));
      ensureTyped(t, n);
      break;
  }

  // Don't count externs since the user's code may not even use that part.
  typeable = typeable && !inExterns;

  if (typeable) {
    doPercentTypedAccounting(t, n);
  }

  checkNoTypeCheckSection(n, false);
}

/**
 * Visits a VAR node.
 *
 * @param t The node traversal object that supplies context, such as the
 * scope chain to use in name lookups as well as error reporting.
 * @param n The node being visited.
 */
private void visitVar(NodeTraversal t, Node n) {
  // TODO(nicksantos): Fix this so that the doc info always shows up
  // on the NAME node. We probably want to wait for the parser
  // merge to fix this.
  JSDocInfo varInfo = n.hasOneChild() ? n.getJSDocInfo() : null;
  for (Node name : n.children()) {
    Node value = name.getFirstChild();
    // A null var would indicate a bug in the scope creation logic.
    Var var = t.getScope().getVar(name.getString());

    if (value != null) {
      JSType valueType = getJSType(value);
      JSType nameType = var.getType();
      nameType = (nameType == null) ? getNativeType(UNKNOWN_TYPE) : nameType;

      JSDocInfo info = name.getJSDocInfo();
      if (info == null) {
        info = varInfo;
      }

      checkEnumAlias(t, info, value);
      if (var.isTypeInferred()) {
        ensureTyped(t, name, valueType);
      } else {
        validator.expectCanAssignTo(
            t, value, valueType, nameType, "initializing variable");
      }
    }
  }
}

/**
 * Expect that the first type can be assigned to a symbol of the second
 * type.
 *
 * @param t The node traversal.
 * @param n The node to issue warnings on.
 * @param rightType The type on the RHS of the assign.
 * @param leftType The type of the symbol on the LHS of the assign.
 * @param msg An extra message for the mismatch warning, if necessary.
 * @return True if the types matched, false otherwise.
 */
boolean expectCanAssignTo(NodeTraversal t, Node n, JSType rightType,
    JSType leftType, String msg) {
  if (!rightType.canAssignTo(leftType)) {
    if ((leftType.isConstructor() || leftType.isEnumType()) && (rightType.isConstructor() || rightType.isEnumType())) {
      registerMismatch(rightType, leftType, null);
    } else {
    mismatch(t, n, msg, rightType, leftType);
    }
    return false;
  }
  return true;
}

